import * as React from 'react';
import Box from '@mui/material/Box';
import TextField from '@mui/material/TextField';




const Post = () => {
    return (
        
        <div>
            <TextField
          id="outlined-multiline-static"
          label="Multiline"
          Escreva
          rows={4}
          defaultValue="Escreva algo"
        />

        </div>
        )
}

export default Post
